import React from "react";
import { FaBars } from "react-icons/fa";
import {
  Nav,
  NavbarContainer,
  NavLogoItem,
  NavLogoContainer,
  MobileIcon,
  NavSlide,
  NavItem,
  NavLinks,
} from "./NavbarElements";

const Navbar = ({ toggle }) => {
  return (
    <>
      <Nav>
        <NavbarContainer>
          <NavLogoContainer>
            <NavLogoItem to="about">Miguel Lopes</NavLogoItem>
            <NavLogoItem to="portfolio">Designer</NavLogoItem>
          </NavLogoContainer>

          {/* <MobileIcon onClick={toggle}>
                  <FaBars />
              </MobileIcon> */}
          <NavSlide>
            <NavItem>
              <NavLinks to="graphics">Graphics</NavLinks>
            </NavItem> 
            <NavItem>
              <NavLinks to="products">/Products</NavLinks>
            </NavItem>
          </NavSlide>
        </NavbarContainer>
      </Nav>
    </>
  );
};

export default Navbar;
